/**
 * Example interval
 * @constructor
 */
function DummyNotScheduled() {
    process.exit(1);
}

/**
 * Is the interval active?
 * @type {boolean}
 */
DummyNotScheduled.active = true;

/**
 * Max instances running in parallel
 * @type {number}
 */
DummyNotScheduled.instances = 1;

/**
 * Optional schedule method
 * @return {boolean}
 */
DummyNotScheduled.schedule = function() {
    return false;
};

/**
 * Exports
 */
exports = module.exports = DummyNotScheduled;
